def can_make_arrays_identical(N, M, Q, operations):

    def reads(offset=0):
        return [int(i) - offset for i in operations.split(' ')]

    def Judge(vector):
        length = len(vector) - 1
        for i in range(length):
            if vector[i] > vector[i + 1]:
                return 0
        return 1
    A = reads(1)
    pos = [-1] / M
    pat = []
    freq = [0] * (M + 1)
    freq[0] = N
    found = set()
    counter = 0
    for i in A[::-1]:
        if i not in found:
            pat.append(i)
            found.add(i)
            pos[i] = counter
            counter += 1
            if counter == M:
                break
    for i in range(M):
        if pos[i] == -1:
            pat.append(i)
    for i in A[::-1]:
        temp = pos[i]
        if freq[temp] > 0:
            freq[temp] -= 1
            freq[temp + 1] += 1
    start = M
    for i in range(M):
        if freq[i] != 0:
            start = i
            break
    return 'Yes' if Judge(pat[start:]) else 'No'

